import { Avatar, TextField, Typography } from '@mui/material';
import { Box } from '@mui/system';
import React, {UseState}from 'react';
import NavbarSeller from './navbarSeller';
import Autocomplete from '@mui/material/Autocomplete';
import { useState } from 'react';
const MyProfile = () => {
                
    const regions = [
        { title: 'Oromia'},
        { title: 'AddisAbaba'},
        { title: 'Amhara'},
        { title: 'Afar' },
        { title: 'Somali' },
        { title: "Sidama" },
        { title: 'BenishangulGumuz'},
        { title: 'Gambella' },
        { title: "SNNP" },
        { title: 'DireDewa'}
    ]
    const [managerFname,setmanagerFname]=useState('');
    const [manageLname,setmanageLname]=useState('');
    const [companyName,setcompanyName]=useState('');
    const [phoneNo,setphoneNo]=useState('');
    const [region,setregion]=useState('')
    const [message,setmessage]=useState('');
    const [city,setCity]=useState('');
    const [auth,setAuth]=useState(false);
    return ( <>
     <NavbarSeller/>
     <Box sx={{
        position:"absolute",

        width:"100%",
        height:"150px",
        backgroundColor:"#860C0C"
     }}>
        <Typography variant= {{xs:"h3",sm:"h4"}} sx={{
            position:"absolute",
            left:"15%",
            top:"60px",
            color:"white",
            alignSelf:"center"
        }}> HARENA.com the leading Ecommerce Website !</Typography>
     </Box>
     <Avatar sx={{
            position:"absolute",
            left:"4%",
            width:"100px",
            top:"110px",
            height:"100px"
        }}></Avatar>
    <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"white",

    }}>
        <form>
        <TextField label="Manager FirstName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Manager LastName"sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }}  ></TextField> 
        <br></br>
        <br></br>
        <TextField label="CompanyName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Phone No" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <Autocomplete
        id="Region"
        freeSolo
        options={regions.map((option) => option.title)}
        renderInput={(params) => <TextField {...params} label="Region" />}
      />
        <TextField label="PhoneNumber" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField label="City" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <TextField label="Stream" sx={{
            marginLeft:"20px",
            marginTop:"10px",
            marginBottom:"30px"
        }} ></TextField>
        
        <button type="submit">Edit</button>
        
    </form>
    <br/>
    <br/>
    <br/>
        <div> ------</div>
    </Box>
    </> 
    );
}

export default MyProfile;
